import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function mob(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/49031/072a4c6e-33d3-4472-a142-2a3ac1668959?autoplay=true" TituloAnime="Mob Psycho 100 " TituloCap="Episodio 1 – El psíquico autoproclamado: Arataka Reigen ~Y Mob~" DescAnime="En este mundo hay gente con poderes sobrenaturales y gente que no. Arataka Reigen es un tipo que tiene una agencia de exorcismos para ganarse la vida y afirma ser una superestrella, pero en realidad siempre depende de su aprendiz, Mob, para hacerle el trabajo sucio."/>
        </div>
    );
}

export default mob;
